function ManageAmendmentHub(){const n=(new signalR.HubConnectionBuilder).withUrl("/amendmentHub").build();n.onclose(()=>{toastr.error("Lost Connection",null,{closeButton:!0})});n.on(_clientNotifierMethods.amendmentChange,n=>{toastr.options.escapeHtml=!0;var t="Amendment "+n.id;switch(n.results.operationType){case 1:t+=" Created";break;case 2:t+=" Updated";break;case 3:t+=" Deleted"}toastr.info(t);jQuery.event.trigger("amendment.amendmentChange",n)});n.on(_clientNotifierMethods.amendmentBodyChange,n=>{toastr.options.escapeHtml=!0;var t="Amendment Body "+n.id;switch(n.results.operationType){case 1:t+=" Created";break;case 2:t+=" Updated";break;case 3:t+=" Deleted"}toastr.info(t);jQuery.event.trigger("amendment.amendmentBodyChange",n)});return n.start().catch(n=>console.error(n.toString())),n}function ManageScreenHub(){const n=(new signalR.HubConnectionBuilder).withUrl("/screenHub").build();n.on(_clientNotifierMethods.goLive,n=>{if(_usersRoles.indexOf("System Administrator")>-1){toastr.options.escapeHtml=!0;var t="screen "+n.id;toastr.info(t,_clientNotifierMethods.goLive)}jQuery.event.trigger("screen.goLive",n)});n.on(_clientNotifierMethods.goLiveBody,n=>{if(_usersRoles.indexOf("System Administrator")>-1){toastr.options.escapeHtml=!0;var t="screen "+n.id;toastr.info(t,_clientNotifierMethods.goLiveBody)}jQuery.event.trigger("screen.goLiveBody",n)});n.on(_clientNotifierMethods.clearScreens,n=>{if(_usersRoles.indexOf("System Administrator")>-1){toastr.options.escapeHtml=!0;var t="screen "+n.id;toastr.info(t,_clientNotifierMethods.clearScreens)}jQuery.event.trigger("screen.clearScreens",n)});n.on(_clientNotifierMethods.amendmentBodyChange,n=>{if(_usersRoles.indexOf("System Administrator")>-1){toastr.options.escapeHtml=!0;var t="screen "+n.id;toastr.info(t,_clientNotifierMethods.amendmentBodyChange)}jQuery.event.trigger("screen.amendmentBodyChange",n)});n.on(_clientNotifierMethods.amendmentChange,n=>{if(_usersRoles.indexOf("System Administrator")>-1){toastr.options.escapeHtml=!0;var t="screen "+n.id;toastr.info(t,_clientNotifierMethods.amendmentChange)}jQuery.event.trigger("screen.amendmentChange",n)});return n.start().catch(n=>console.error(n.toString())),n}function convertArrayToObservable(n){var t=[];return $.each(n,function(n,i){var r=convertToObservable(i);t.push(r)}),t}function convertToObservable(n){var t={};return Object.keys(n).forEach(function(i){t[i]=Array.isArray(n[i])?ko.observableArray(convertArrayToObservable(n[i])):ko.observable(n[i])}),t}function arrayFirstIndexOf(n,t,i){for(var r=0,u=n.length;r<u;r++)if(t.call(i,n[r]))return r;return-1}